void UAVModel::lfct(typeRNum *out, ctypeRNum t, ctypeRNum *x, ctypeRNum *u, ctypeRNum *p, ctypeRNum *xdes, ctypeRNum *udes) 
{
    // integral cost
    int nx = 9;
    int nu = 8;
    ctypeRNum* xdes_temp;
    ctypeRNum* udes_temp;
    int des_index;

    ctypeRNum* param = (ctypeRNum*)this->userparam.data();

    typeRNum dt = param[0];
    typeRNum Thor = param[1];
    int num_xtraj = (Thor/dt +1)*nx;
    int num_utraj = (Thor/dt +1)*nu;
    int size_userparam =num_xtraj + num_utraj + 2;

    des_index = floor(t/dt);
    xdes_temp = param + 2 + des_index*nx;
    udes_temp = param + 2 + num_xtraj + des_index*nu;


    out[0] = 0;
    typeRNum Q[9] = {20,20,20,20,20,20,20,20,20};
    for (int i = 0; i < nx; i++) {
        out[0] = out[0] + Q[i] * POW2(x[i] - xdes_temp[i]); 
    }

    typeRNum R[8] = {10,10,10,10,10,10,10,10}; 
    for (int i = 0; i < nu; i++) {
        out[0] = out[0] + R[i] * POW2(u[i] - udes_temp[i]); 
    }

    out[0] = out[0] * 0.5;
}

void UAVModel::dldx(typeRNum *out, ctypeRNum t, ctypeRNum *x, ctypeRNum *u, ctypeRNum *p, ctypeRNum *xdes, ctypeRNum *udes) 
{
    // partial derivatives w.r.t. u
    int nx = 9;
    ctypeRNum* xdes_temp;
    ctypeRNum* param = (ctypeRNum*)this->userparam.data();

    int des_index;
    typeRNum dt = param[0];
    typeRNum Thor = param[1];

    des_index = floor(t/dt);
    xdes_temp = param + 2 + des_index*nx;

    
    typeRNum Q[9] = {10,50,10,200,20,20,10,100,10};
    for (int i = 0; i < nx; i++) {
        out[i] = Q[i] * (x[i] - xdes_temp[i]); // param[0:Nx-1] are Nx Q_Parameters of Q matrix
    }
}

void UAVModel::dldu(typeRNum *out, ctypeRNum t, ctypeRNum *x, ctypeRNum *u, ctypeRNum *p, ctypeRNum *xdes, ctypeRNum *udes) 
{
    // partial derivatives w.r.t. u
    int nx = 9;
    int nu = 8;
    ctypeRNum* udes_temp;
    ctypeRNum* param = (ctypeRNum*)this->userparam.data(); ;

    int des_index;
    typeRNum dt = param[0];
    typeRNum Thor = param[1];

    int num_xtraj = (Thor/dt +1)*nx;

    des_index = floor(t/dt);
    udes_temp = param + 2 + num_xtraj + des_index*nu;
    
    typeRNum R[8] = {10,10,10,10,10,10,10,10}; 
    for (int i = 0; i < nu; i++) {
        out[i] = R[i] * (u[i] - udes_temp[i]); // param[Nx+1:Nx+Nu] are Nu R_Parameters of R matrix
    }
}  

void UAVModel::Vfct(typeRNum *out, ctypeRNum T, ctypeRNum *x, ctypeRNum *p, ctypeRNum *xdes) 
{
    // terminal cost
    int nx = 9;
    ctypeRNum* xdes_temp;
    ctypeRNum* param = (ctypeRNum*)this->userparam.data(); ;

    int des_index;
    typeRNum dt = param[0];
    typeRNum Thor = param[1];

    des_index = ceil(T/dt);
    xdes_temp = param + 2 + des_index*nx;

    typeRNum Q_T[9] = {100,100,100,2000,200,200,100,1000,100};
    for (int i = 0; i < nx; i++)
    {
        out[0] = out[0] + Q_T[i] * (x[i] - xdes_temp[i]) * (x[i] - xdes_temp[i]);
        // param[Nx+Nu+1 :2*Nx+Nu] are Nx Q_Parameters of the second Q matrix
    }
    out[0] = out[0] * 0.5;
}

void UAVModel::dVdx(typeRNum *out, ctypeRNum T, ctypeRNum *x, ctypeRNum *p, ctypeRNum *xdes) 
{
    // partial derivatives w.r.t. T
    int nx = 9;
    ctypeRNum* xdes_temp;
    ctypeRNum* param = (ctypeRNum*)this->userparam.data(); ;

    int des_index;
    typeRNum dt = param[0];
    typeRNum Thor = param[1];

    des_index = ceil(T/dt);
    xdes_temp = param + 2 + des_index*nx;
    
    typeRNum Q[9] = {20,20,20,20,20,20,20,20};

    for (int i = 0; i < nx; i++) {
        out[i] = Q[i] * (x[i] - xdes_temp[i]);
        // param[Nx+Nu+1 :2*Nx+Nu] are Nx Q_Parameters of the second Q matrix
    }
}

int UAVModel::sign(double x) 
{
    return (x > 0.0) - (x < 0.0);
}

void UAVModel::updateTrajData(const char* filename1, const char* filename2, int iMPC) 
{
    int num_xtraj = static_cast<int>((Thor / dt + 1) * 9);
    int num_utraj = static_cast<int>((Thor / dt + 1) * 8);
    int n = static_cast<int>(ceil(dt / 0.01));
    
    
    std::vector<typeRNum> x_traj(num_xtraj);
    std::vector<typeRNum> u_traj(num_utraj);

    
    desReader(x_traj.data(), 9, filename1, iMPC * n + 1, Thor, dt);
    desReader(u_traj.data(), 8, filename2, iMPC * n + 1, Thor, dt);

    
    for (int i = 2; i < 2 + num_xtraj; ++i) {
        userparam[i] = x_traj[i - 2];
    }

    for (int j = 2 + num_xtraj; j < 2 + num_xtraj + num_utraj; ++j) {
        userparam[j] = u_traj[j - 2 - num_xtraj];
    }
}
std::array<double, 9> UAVModel::rk4(const std::array<double, 9>& state, const std::array<double, 8>& input)
{
    std::array<double, 9> k1, k2, k3, k4, new_state;
    double t = 0.0;
    typeRNum *p = nullptr;

    ffct(k1.data(), t, state.data(), input.data(), p);

    std::array<double, 9> state_mid;
    for (size_t i = 0; i < 9; ++i) {
        state_mid[i] = state[i] + dt / 2.0 * k1[i];
    }
    ffct(k2.data(), t + dt / 2.0, state_mid.data(), input.data(), p);

    for (size_t i = 0; i < 9; ++i) {
        state_mid[i] = state[i] + dt / 2.0 * k2[i];
    }
    ffct(k3.data(), t + dt / 2.0, state_mid.data(), input.data(), p);

    for (size_t i = 0; i < 9; ++i) {
        state_mid[i] = state[i] + dt * k3[i];
    }
    ffct(k4.data(), t + dt, state_mid.data(), input.data(), p);

    for (size_t i = 0; i < 9; ++i) {
        new_state[i] = state[i] + dt / 6.0 * (k1[i] + 2 * k2[i] + 2 * k3[i] + k4[i]);
    }

    return new_state;

}


